State files an Amended Information charging Count 1, PTC Felony Retail Theft, contrary 943.50(1m)(b) & 939.05 of the Wisconsin Statutes and Count 2,  Criminal Trespass to Dwelling, contrary to 943.14 of the Wisconsin Statutes.  
Guilty pleas to both charge.   
Count 1 - Court withholds entry of judgment of conviction and approves the Deferred Judgment Agreement.  Review   09-17-2016.  
Count 2 - Convicted.  Sentence is withheld.  Defendant is placed on probation to DOC for twelve (12) months.  Conditions of probation are:
1) Have no contact with Jonni Lynn Webster and Raquel Denn;
2) Have no contact with Walmart;
3) Maintain full-time employment/schooling/job search combination;
4) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
5) Thirty (30) days jail; Ten (10) days up front, under the Huber Law, to commence on 11-16-14 at 5:00 p.m.  Transfer to Shawano County Jail is authorized.  Twenty (20) days jail, stayed, to be imposed upon the agent's discretion.  
6) Pay costs of action;
7) Pay supervision fees in an amount to be determined by DOC.  
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief.  
$50.00 cash bail returned to defendant's mother by check instruction No. CR 129.  
Minutes.
